import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import "../App.css";
import { LoginResponse } from "./Login";

export const Logout: React.FC<LoginResponse> = (props) => {
  const [localProps, setLocalProps] = useState(props);
  const navigate = useNavigate();

  useEffect(() => {
    setLocalProps(props);
    console.log("Logout updated props:", props);
  }, [props]);

  const isLoggedIn = localStorage.getItem("isLoggedIn");

  const handleLogout = () => {
    localStorage.removeItem("isLoggedIn");
    navigate("/login");
  };

  const handlePassword = () => {
    console.log("Navigating to change password");
    navigate("/changePassword");
  };

  console.log("Logout render props:", localProps);

  return (
    <>
      {isLoggedIn === "true" ? (
        <div className="nav-padding">
          <nav className="navbar navbar-expand-lg">
            <div>
              {localProps.changePassword || "No password change message"}
            </div>
            <div className="ms-auto">
              <button
                type="button"
                className="btn btn-primary change-password"
                onClick={handlePassword}
              >
                Passwort Ã¤ndern
              </button>
              <button
                type="button"
                className="btn btn-primary"
                onClick={handleLogout}
              >
                Ausloggen
              </button>
            </div>
          </nav>
          <hr className="hr" />
        </div>
      ) : (
        <div></div>
      )}
    </>
  );
};
